import './App.css';
import Read from './components/combos/read.js';
import { BrowserRouter as Router, Route} from 'react-router-dom';


function App() {
  return (
    <Router>
      <div className='main'>
          <h2 className='mian-header'> Trabajo de CL</h2>




          <div>
            <Route exact path="/" component={Read}></Route>
          </div>


      </div>
    </Router>
  )

}

export default App;
